const Container = styled.button`
  color: ${theme.colors.text.white};
  background-color: ${theme.colors.ui.blue};

  width: 80px;
  height: 40px;

  border-radius: 15px;

  outline: none;
  border: none;

  ${ButtonHover}
`;

const SearchButton: FunctionComponent = () => {
  return <Container>search</Container>;
